import React from 'react'
import { Link, NavLink } from 'react-router-dom'
import useActions from '../hooks/useActions';
export function Cabinet(){
    const {logout}=useActions();
    return(
        <div>
            Cabinet
            <button onClick={logout}>Logout</button>
        </div>
    )
}
